import React from 'react';
import logo from './logo.svg';
import './App.css';
import User from './components/User'

function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>
      <div> 
        User.map(u => <User key={undefined.id} user={u} />
      </div>
    </div>
  );
}

export default App;
